import { Link } from "react-router-dom";

export default function Navbar() {
    return (
        <ul>
            <li>
                <Link to={"/"}>Home</Link>
            </li>
            <li>
                <Link to={"/sobre"}>Sobre</Link>
            </li>
            <li>
                <Link to={"/contato"}>Contato</Link>
            </li>
        </ul>
    );
}
